export class SchemaValidationError extends Error {
    errors;
    constructor(message, errors) {
        super(message);
        this.name = "SchemaValidationError";
        this.errors = errors;
    }
}
export function validateSchemaWith(validator, schema, payload) {
    validator(schema, payload);
}
async function loadAjv() {
    const loader = new Function("moduleName", "return import(moduleName);");
    const mod = await loader("ajv");
    return mod.default ?? mod;
}
export async function validateSchemaWithAjv(schema, payload) {
    const Ajv = await loadAjv();
    const ajv = new Ajv({ allErrors: true, strict: false });
    const validate = ajv.compile(schema);
    const ok = validate(payload);
    if (!ok) {
        throw new SchemaValidationError("Schema validation failed.", validate.errors);
    }
}
